          <div className={'cursive biggestText circle-background col-md'}>1</div>
        </div>
        <div className={'d-flex flex-column align-items-center  col-md-4'}>
          <div className={'cursive biggestText circle-background2 col-md'}>2</div>
        </div>
        <div className={'d-flex flex-column align-items-center col-md-4'}>
          <div className={'cursive biggestText circle-background3 col-md'}>3</div>
        </div>
      </div>
    </div>
  )
};
